import { StyleSheet } from "react-native"


const styles = StyleSheet.create({
    cardLogin:{
        backgroundColor: '#e7eaf6',
        padding: 30,
        borderRadius: 15,
    },
    tituloLogin:{
        fontFamily: "Roboto",
        fontSize: 25,
        color: 'black',
        paddingBottom: 20
    },
    inputsLogin:{
        backgroundColor: "#e7e8f5",
        height: 30,
        borderStyle: 'solid',
        borderColor: 'black',
        borderWidth: 2,
        borderRadius: 15
        
    }
})

export default styles;
